// CardComponent.tsx
import React from 'react';
import { CardComponentStyled, CardUpper ,CardUppermore, FullDiv, Leftpart, LeftTextpart, Styledimage, Upperpart, UpperText } from "../Dashboard.styles";

interface CardProps {
  id: number;
  imageBuyer: string;
  buyer: string;
  seller: string;
  imageSeller: string;
  tenure: string;
  unitcost: string;
  totalunit: string;
  xirr: string;
  remainingunit: string;
}

const CardComponent: React.FC<CardProps> = ({ id, imageBuyer, buyer, seller, imageSeller, tenure, unitcost, totalunit, xirr, remainingunit }) => {
  return (
    <CardComponentStyled>
      <CardUpper>
        <CardUppermore>
          <UpperText>
           INVOICE DISCOUNTING
          </UpperText>
          <FullDiv>
            <Upperpart>
              <Leftpart>
                <Styledimage src={imageBuyer}/>
                <LeftTextpart>{buyer}</LeftTextpart>
              </Leftpart>

            </Upperpart>
          </FullDiv>
          
          </CardUppermore>  

      </CardUpper>
    </CardComponentStyled>
  );
};

export default CardComponent;
